import React from "react";
import { emphasize, withStyles, makeStyles } from "@material-ui/core/styles";
import { AppBar, Toolbar, Breadcrumbs, Typography } from "@material-ui/core";
import Chip from "@material-ui/core/Chip";
import HomeIcon from "@material-ui/icons/Home";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import Link from "next/Link";

const StyledBreadcrumb = withStyles(theme => ({
  root: {
    backgroundColor: theme.palette.grey[100],
    height: theme.spacing(3),
    color: theme.palette.grey[800],
    fontWeight: theme.typography.fontWeightRegular,
    "&:hover, &:focus": {
      backgroundColor: theme.palette.grey[300]
    },
    "&:active": {
      boxShadow: theme.shadows[1],
      backgroundColor: emphasize(theme.palette.grey[300], 0.12)
    }
  }
}))(Chip);

const useStyles = makeStyles(theme => ({
  offset: theme.mixins.toolbar,
  link: {
    color: theme.palette.primary.contrastText
  }
}));

export default function Header(props) {
  const classes = useStyles();

  return (
    <AppBar>
      <Toolbar>
        <Breadcrumbs aria-label="breadcrumb">
          <Link
            color="inherit
        "
            href="/home"
          >
            <a>
              <Typography>The Asterisk Lounge</Typography>
            </a>
          </Link>
          <Link href="/posts">
            <a>
              <Typography>Posts</Typography>
            </a>
          </Link>
          <Typography color="inherit">Post</Typography>
        </Breadcrumbs>
      </Toolbar>
      <Toolbar>
        <StyledBreadcrumb
          component="a"
          href="#"
          label="Home"
          icon={<HomeIcon fontSize="small" />}
        />
        <StyledBreadcrumb component="a" href="#" label="Catalog" />
        <StyledBreadcrumb label="Accessories" deleteIcon={<ExpandMoreIcon />} />
      </Toolbar>
    </AppBar>
  );
}
